import * as React from 'react';
import { View, Text } from 'react-native';

export const Screen1 = ({navigation, route}) =>{
    const { etudiant} = route.params;
    return(
        
        <View>
            
            <Text>Screen1</Text>
            <Text>Details Screen</Text>
            <Text>itemId: {JSON.parse(etudiant.id)}</Text>
         
        </View>
    );
}
